import React from 'react'
import './Header.css'

function Header() {
    return (
        <div className='header'>
            <div className="header__left">
            <a href="https://iconscout.com/icons/facebook-logo-2019" target="_blank">Facebook logo 2019 Logo Icon</a> by <a href="https://iconscout.com/contributors/icon-mafia" target="_blank">Icon Mafia</a>
            </div>

            <div className="header__middle"></div>

            <div className="header__right"></div>
    </div>
    );
}

//rcfe extension = es7
export default Header
